import React, { Component } from "react";
import { Link } from "react-router-dom";

import backgroundImage from '../../paintings.json'

import styles from './Home.module.css';

class Home extends Component {

  componentDidMount() {
    console.log(backgroundImage.backgroundImage.src)
  }

  render() {
    return (
      <div styles={{ backgroundImage: `${backgroundImage.backgroundImage.src}` }}>
        <div className={styles.header}>Kimmi Risk's Art Gallery</div>
        <img src={backgroundImage.backgroundImage.src} />
      </div>
    );
  }
}

export default Home;
